@import '../mixins';

.appointment {
  @include position-centered;
  display: flex;
  flex-direction: column;


  .appointment__container {
    height: 440px;
    width: $block-width;
    position: relative;
    margin-top: 100px;

    .appointment__content {
      position: absolute;
      top: 53px;
      left: 62px;
      z-index: 15;

      .appointment__title {
        font-size: 38px;
        font-style: normal;
        font-weight: 700;
        line-height: normal;
        text-transform: uppercase;
        color: $color-5;
      }

      .appointment__small-title {
        font-size: 22px;
        font-style: normal;
        font-weight: 700;
        line-height: normal;
        color: $color-5;
      }

      .appointment__list {
        margin-top: 16px;
        color: $color-3;
        display: flex;
        flex-direction: column;
        justify-content: flex-start;
        gap: 9px;

        .appointment__list-element {
          list-style-type: none;
          text-indent:-5px;
          &::before {
            display: inline-block;
            color: $color-3;
            content: "•";
            margin-left: 3px;
            padding-right: 10px;
          }
        }

        .appointment__list-span {
          font-size: 16px;
          font-style: normal;
          font-weight: 400;
          line-height: normal;
          color: $color-5;
        }
      }

      .appointment__price {
        font-size: 20px;
        font-style: normal;
        font-weight: 400;
        line-height: normal;
        color: $color-5;
        display: flex;
        margin-top: 33px;
        gap: 16px;

        .appointment__price_crossed {
          color: $color-6;
          text-decoration: line-through;
        }
      }

      .appointment__button-container {
        margin-top: 27px;
        display: flex;
        gap: 14px;

        .appointment__button {
          @include button-common-styles;
        }

        .appointment__button_color_green {
          background-color: $color-1;
          color: $color-2;
          transition: .1s linear;
          cursor: pointer;

          &:hover {
            opacity: $opacity;
          }
        }

        .appointment__button_color_white {
          background-color: $color-7;
          border: 2px solid $color-1;
          transition: .1s linear;
          cursor: pointer;

          &:hover {
            opacity: $opacity;
          }
        }
      }
    }

    .appointment__foreground-image {
      position: absolute;
      top: 0;
      left: 0;
      z-index: 10;
    }

    .appointment__background-image {
      z-index: 5;
      position: absolute;
      top: 0;
      right: 0;
    }
  }

  .appointment__slider-buttons {
    margin-top: 34px;
    margin-bottom: 94px;
    display: flex;
    align-items: center;
    gap: 36px;

    .appointment__arrow-button {
      width: $arrow-size;
      height: $arrow-size;
      cursor: pointer;
      transition: .1s linear;
      
      &:hover {
        opacity: $opacity;
      }
    }

    .appointment__pages {
      font-size: 18px;
      font-weight: 400;
      font-style: normal;
      line-height: normal;

      .appointment__total-pages {
        color: $color-8;
      }
    }
  }
}
